

-- Drop table if exists circuits
DROP TABLE IF EXISTS circuits;

-- Table structure for circuits
CREATE TABLE circuits (circuitId INT NOT NULL, circuitRef VARCHAR(14) NOT NULL, name VARCHAR(37) NOT NULL, location VARCHAR(21) NOT NULL, country VARCHAR(12) NOT NULL, lat DOUBLE NOT NULL, lng DOUBLE NOT NULL, alt VARCHAR(2), url VARCHAR(71) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Drop table if exists races
DROP TABLE IF EXISTS races;

-- Table structure for races
CREATE TABLE races (raceId INT NOT NULL, year INT NOT NULL, round INT NOT NULL, circuitId INT NOT NULL, name VARCHAR(29) NOT NULL, date VARCHAR(10) NOT NULL, time VARCHAR(8), url VARCHAR(63) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Drop table if exists drivers
DROP TABLE IF EXISTS drivers;

-- Table structure for drivers
CREATE TABLE drivers (driverId INT NOT NULL, driverRef VARCHAR(18) NOT NULL, number VARCHAR(2), code VARCHAR(3), forename VARCHAR(17) NOT NULL, surname VARCHAR(23) NOT NULL, dob VARCHAR(10), nationality VARCHAR(17) NOT NULL, url VARCHAR(65)) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Drop table if exists status
DROP TABLE IF EXISTS status;

-- Table structure for status
CREATE TABLE status (statusId INT NOT NULL, status VARCHAR(18) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Drop table if exists seasons
DROP TABLE IF EXISTS seasons;

-- Table structure for seasons
CREATE TABLE seasons (year INT NOT NULL, url VARCHAR(68) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Drop table if exists constructors
DROP TABLE IF EXISTS constructors;

-- Table structure for constructors
CREATE TABLE constructors (constructorId INT NOT NULL, constructorRef VARCHAR(20) NOT NULL, name VARCHAR(25) NOT NULL, nationality VARCHAR(13) NOT NULL, url VARCHAR(73) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Drop table if exists constructorStandings
DROP TABLE IF EXISTS constructorStandings;

-- Table structure for constructorStandings
CREATE TABLE constructorStandings (constructorStandingsId INT NOT NULL, raceId INT NOT NULL, constructorId INT NOT NULL, points DOUBLE NOT NULL, position INT NOT NULL, positionText VARCHAR(2) NOT NULL, wins INT NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
